import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open the cart modal (try clicking on the cart div by its text content)
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.click('div.cart');

    // Wait for the cart modal to appear by looking for the "Your cart is empty" text OR a "Remove" button
    // Try to wait for the Remove button (it only appears if there are items)
    let removeButtonFound = false;
    let cartItemTitle = null;
    try {
      await page.waitForSelector('button.remove-item', { timeout: 2000 });
      removeButtonFound = true;
    } catch (e) {
      // If not found, check for empty cart
      await page.waitForSelector('text=Your cart is empty', { timeout: 2000 });
    }

    // Screenshot of the cart before removal
    const step2 = path.join(screenshotsDir, 'step_2_cart_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    let removedTitle = null;
    if (removeButtonFound) {
      // Get the cart item title before removal for verification
      const titleElem = await page.$('.cart-item-title');
      if (titleElem) {
        cartItemTitle = await titleElem.textContent();
      }

      // Click the first remove button
      await page.click('button.remove-item');

      // Wait for either the cart to be empty or the item to disappear
      try {
        await page.waitForSelector('text=Your cart is empty', { timeout: 3000 });
      } catch (e) {
        // If not empty, wait for the cart item title to disappear
        if (cartItemTitle) {
          await page.waitForSelector(`.cart-item-title:text-is("${cartItemTitle.trim()}")`, { state: 'detached', timeout: 3000 });
        }
      }
      removedTitle = cartItemTitle ? cartItemTitle.trim() : null;
    }

    // Screenshot after removal
    const step3 = path.join(screenshotsDir, 'step_3_cart_after_removal.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract cart status for verification
    let cartStatus = '';
    if (await page.$('text=Your cart is empty')) {
      cartStatus = 'empty';
    } else {
      // Try to get remaining cart item titles
      const titles = await page.$$eval('.cart-item-title', els => els.map(e => e.textContent.trim()));
      cartStatus = titles.length > 0 ? `items_remaining: ${titles.join(', ')}` : 'unknown';
    }

    return {
      success: true,
      action: removeButtonFound
        ? `Removed item "${removedTitle}" from cart`
        : "No items in cart to remove",
      extractedData: {
        removedTitle,
        cartStatus
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
